import axios from "axios";
const Api = async () => {
    try{
        let users = 
            await axios.get('https://assessment.api.vweb.app/user')
                        .then( 
                                res => {
                                    console.log(res.data)
                                } 
                            );
        
        return users;
    }catch(err){
        console.log(err)
    }
}
export default Api;
